Sure! To write an if/then statement in C programming language, you can use the following syntax:

if (condition) {
  // Code to execute if the condition is true
} else {
  // Code to execute if the condition is false
}

For example, you can write an if/then statement to check if a number is greater than 10 and print a message accordingly:

int num = 15;

if (num > 10) {
  printf("The number is greater than 10.");
} else {
  printf("The number is not greater than 10.");
}
